import React from 'react';
import { Navbar, Nav as BootstrapNav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function Nav() {
  return (
    <Navbar bg="body-tertiary" expand="lg">
      <div className="container-fluid">
        <Navbar.Toggle aria-controls="navbarTogglerDemo03" />
        <Navbar.Collapse id="navbarTogglerDemo03">
          <BootstrapNav className="me-auto mb-2 mb-lg-0">
            <BootstrapNav.Item>
              <BootstrapNav.Link href="#" active>Home</BootstrapNav.Link>
            </BootstrapNav.Item>
            <BootstrapNav.Item>
              <BootstrapNav.Link href="#">Link</BootstrapNav.Link>
            </BootstrapNav.Item>
            <BootstrapNav.Item>
              <BootstrapNav.Link disabled>Disabled</BootstrapNav.Link>
            </BootstrapNav.Item>
          </BootstrapNav>
          <Form className="d-flex" role="search">
            <FormControl type="search" placeholder="Search" aria-label="Search" />
            <Button variant="outline-success" type="submit">Search</Button>
          </Form>
        </Navbar.Collapse>
      </div>
    </Navbar>
  );
}

export default Nav;
